import React from 'react';

export default function WhatsInYourFood() {
  return (
    <div style={{padding: '24px', maxWidth: 900, margin: '0 auto'}}>
      <h1>What's in your food?</h1>
      <p>
        This page is a placeholder for the "What's in your food?" help content.
        You can add information about nutrition, sourcing, allergens, or links
        to external resources here.
      </p>
      <p>
        To edit this page, modify <code>src/pages/WhatsInYourFood.js</code>.
      </p>
      <p>
        <a href="/">Back to app</a>
      </p>
    </div>
  );
}
